import './App.css';
import React, { useState, useEffect } from 'react';
import clsx from 'clsx';

import { makeStyles } from '@material-ui/core/styles';
import CssBaseline from '@material-ui/core/CssBaseline';

import Container from '@material-ui/core/Container';
import Grid from '@material-ui/core/Grid';
import Paper from '@material-ui/core/Paper';

// Data.js import to display table data
import Data from './Data';

import TextField from '@material-ui/core/TextField';
import Button from '@material-ui/core/Button';

import InputAdornment from '@material-ui/core/InputAdornment';
import SearchIcon from '@material-ui/icons/Search';
import AddIcon from '@material-ui/icons/Add';

const useStyles = makeStyles((theme) => ({
  content: {
    flexGrow: 1,
    height: '100vh',
    overflow: 'auto',
  },

  container: {
    paddingTop: theme.spacing(1),
    paddingBottom: theme.spacing(4),
  },

}));

function App() {
  const classes = useStyles();
  const fixedHeightPaperTable = clsx(classes.paper, classes.fixedHeightTable);
  return (
    <div>
      <CssBaseline />
      <main className={classes.content}>
      <Container maxWidth="lg" className={classes.container}>
        <h4>MANAGEMENT</h4>
        <h1>Clients</h1>
        {/* <Grid container spacing={3}>           
            <form noValidate autoComplete="off">             
                <TextField id="outlined-basic" label="Search" variant="outlined" size="small"
                  InputProps={{
                    startAdornment: (
                      <InputAdornment position="start">
                        <SearchIcon />
                      </InputAdornment>
                    ),
                  }}
                />
                <Button variant="outlined" color="primary">SEARCH</Button>              
                <Button variant="outlined" color="primary" type="reset" >CLEAR</Button>            
            </form>
            <Button variant="outlined" color="primary"><AddIcon />NEW CLIENT</Button>
        </Grid> */}

        <Grid container spacing={1}>
          <Grid container item xs={12} spacing={2}>    
            <Grid item xs={2}>
              <TextField id="outlined-basic" label="Search" variant="outlined" size="small"
                InputProps={{
                  startAdornment: (
                    <InputAdornment position="start">
                      <SearchIcon />
                    </InputAdornment>
                  ),
                }}
              />
            </Grid>
            <Grid item xs={1}>
              <Button variant="outlined" color="primary">SEARCH</Button>                
            </Grid>
            <Grid item xs={1}>      
              <Button variant="outlined" color="primary" type="reset" >CLEAR</Button>    
            </Grid>
            <Grid item xs={6}>      
            </Grid>
            <Grid item xs={2}>
              <Button variant="outlined" color="primary"><AddIcon />NEW CLIENT</Button>
            </Grid>
          </Grid>
        </Grid>       

        <br />                  

        {/* Data.js, API data fetching and displaying */}
        <Data />
      </Container>
      </main>
    </div>
  );
}

export default App;
